import React from "react";
import {Field} from "react-final-form";
import {Form} from "redux-final-form";

export const Login = () => {
    return <div>
        <h1>LOGIN</h1>
        <LoginForm/>
    </div>
}

type LoginFormType = {}
const LoginForm: React.FC<LoginFormType> = () => {
    return <Form>
        <Field
            name='Login'
            component="input"
            placeholder='Login'/>
    </Form>
}
